import React,{useState} from "react"

function Login(){
const[text,setText]=useState(
    {login:"",
    password:"",
    phone:"",
    name:"",
    surname:""}
    )


    return(    <div className="input_surname">
   <div>
    <input type="text" placeholder="введите ваше имя" value={text.name} onChange={e=>setText(p=>{
        return {...p,name:e.target.value}
    })}></input>
   </div>
    </div>
    )
}
export default Login
